(267, 'DSEOP1RNARYZ', 104, 15, 'Sailendrah Apannah', 168, 'Sailendra Appannah', NULL, NULL, 'Job Recruiting Platform', '2023-04-08', NULL, '2022-12-31', '3643.1996036199', 3000, 2, '2022-12-31', 'https://www.freelancer.com/projects/html/job-recruiting-platform', 'https://www.freelancer.com/projects/html/job-recruiting-platform', NULL, 'Awaiting for client Response', NULL, '<p>Looking for a talented developer to build a Recruitment platform. In simple terms the platform or web application can be thought of as a stand alone version of LinkedIn\'s Recruiter tool. There will be no social elements like social messaging, networking or feeds. Job seekers will only have the ability to create profiles, upload work examples and respond to messages form employers. Employers will also have the ability to create profiles but with the added functionality to search for candidates with skills they want and contact them via direct message. The features are quite simple but will need to be executed well with clean code that can be built on in future. If you feel you can get the job done but would like to present a counter offer for your quote, please provide a quote you feel will best enable you get the job done efficiently and effectively.</p><p><br></p><p>Skills: HTML, Laravel, Backend Development, Full Stack Development, PHP, Software Architecture, Software Development,', '<p>Looking for a talented developer to build a Recruitment platform. In simple terms the platform or web application can be thought of as a stand alone version of LinkedIn\'s Recruiter tool. There will be no social elements like social messaging, networking or feeds. Job seekers will only have the ability to create profiles, upload work examples and respond to messages form employers. Employers will also have the ability to create profiles but with the added functionality to search for candidates with skills they want and contact them via direct message. The features are quite simple but will need to be executed