INSERT INTO `knowledge_bases` (`id`, `heading`, `to`, `category_id`, `description`, `added_by`, `created_at`, `updated_at`) VALUES
(1, 'SeoPage1 Enterprise Solution System', 'employee', 1, '<p><span style=\"color: rgb(0, 0, 0);\">SEOPage1 was launched in November 10, 2012 initially as a content writing agency with headquarters in Dhaka, Bangladesh. Our services revolve primarily around 1. Creating quality content, 2. On-page optimization, and 3. Helping clients to have better search engine results with our contents. Our team started with 6 dedicated members who were experts in writing articles, blog posts, web contents, E-books and all other types of contents. Currently we have around 10 in-house employees in our office and more than 50 online service providers.</span></p>', 1, '2022-10-05 20:50:24', '2022-10-05 20:50:24');
