INSERT INTO `leads` (`id`, `client_id`, `source_id`, `status_id`, `column_priority`, `agent_id`, `company_name`, `website`, `address`, `salutation`, `client_name`, `project_id`, `project_name`, `project_link`, `bidding_minutes`, `bidding_seconds`, `client_email`, `mobile`, `cell`, `office`, `city`, `state`, `country`, `postal_code`, `note`, `cover_letter`, `next_follow_up`, `value`, `actual_value`, `bid_value`, `bid_value2`, `currency_id`, `original_currency_id`, `category_id`, `added_by`, `last_updated_by`, `hash`, `deal_status`, `deadline`, `insight_screenshot`, `bidpage_screenshot`, `projectpage_screenshot`, `created_at`, `updated_at`) VALUES
(104, NULL, NULL, 3, 0, NULL, NULL, NULL, NULL, NULL, 'Job Recruiting Platform', '35631446', NULL, 'https://www.freelancer.com/projects/html/job-recruiting-platform', 24, 10, NULL, NULL, NULL, NULL, NULL, NULL, 'United Kingdom', NULL, '<p>Looking for a talented developer to build a Recruitment platform. In simple terms the platform or web application can be thought of as a stand alone version of LinkedIn\'s Recruiter tool. There will be no social elements like social messaging, networking or feeds. Job seekers will only have the ability to create profiles, upload work examples and respond to messages form employers. Employers will also have the ability to create profiles but with the added functionality to search for candidates with skills they want and contact them via direct message. The features are quite simple but will need to be executed well with clean code that can be built on in future. If you feel you can get the job done but would like to present a counter offer for your quote, please provide a quote you feel will best enable you get the job done efficiently and effectively.</p><p><br></p><p>Skills: HTML, Laravel, Backend Development, Full Stack Development, PHP, Software Architecture, Software Development, Web Application, Web Development</p>', '<p>Looking for a talented developer to build a Recruitment platform. In simple terms the platform or web application can be thought of as a stand alone version of LinkedIn\'s Recruiter tool. There will be no social elements like social messaging, networking or feeds. Job seekers will only have the ability to create profiles, upload work examples and respond to messages form employers. Employers will also have the ability to create profiles but with the added functionality to search for candidates with skills they want and contact them via direct message. The features are quite simple but will need to be executed well with clean code that can be built on in future. If you feel you can get the job done but would li