INSERT INTO `projects` (`id`, `project_name`, `project_short_code`, `project_summary`, `project_challenge`, `project_admin`, `deal_id`, `pm_id`, `start_date`, `deadline`, `notes`, `category_id`, `client_id`, `team_id`, `feedback`, `manual_timelog`, `client_view_task`, `column_priority`, `allow_client_notification`, `completion_percent`, `calculate_task_progress`, `project_budget`, `due`, `milestone_paid`, `paid_milestone_count`, `currency_id`, `hours_allocated`, `status`, `status_id`, `dispute_status`, `project_status`, `added_by`, `last_updated_by`, `hash`, `public`, `created_at`, `updated_at`, `deleted_at`) VALUES
(257, 'Job Recruiting Platform', 'PSEOP178CUTP', '<p>Looking for a talented developer to build a Recruitment platform. In simple terms the platform or web application can be thought of as a stand alone version of LinkedIn\'s Recruiter tool. There will be no social elements like social messaging, networking or feeds. Job seekers will only have the ability to create profiles, upload work examples and respond to messages form employers. Employers will also have the ability to create profiles but with the added functionality to search for candidates with skills they want and contact them via direct message. The features are quite simple but will need to be executed well with clean code that can be built on in future. If you feel you can get the job done but would like to present a counter offer for your quote, please provide a quote you feel will best enable you get the job done efficiently and effectively.</p><p><br></p><p>Skills: HTML, Laravel, Backend Development, Full Stack Development, PHP, Software Architecture, Software Development, Web Application, Web Development</p>', '<p>Some Challenges on APi Development </p>', 15, 267, 15, '2022-12-31', '2023-04-08', NULL, 2, 168, 1, NULL, 'disable', 'disable', NULL, 'disable', 100, 'false', 3643.20, 0, 3643.2, 3, 1, NULL, 'finished', NULL, 0, 'Accepted', 74, 15, '4EIVdUm2MgY1f5H3m5a3SsSZdx6aGJpi', 0, '2022-12-30 20:55:07', '2022-12-31 00:23:10', NULL),
(258, 'flutter backend + frontend database postgresql admin + user panel -- 2', 'PSEOP18BI83M', '<p>Application Features:</p><p><br></p><p>flutter backend + frontend database postgresql admin + user panel</p><p><br></p><p>SQL Protection Against Hacking</p><p><br></p><p>See videos and posts</p><p><br></p><p>Manage hashtags and move them to explore screen</p><p><br></p><p>Computer Mobile and Tablet Support</p><p><br></p><p>Support: Live, Movies, Live TV,and Series Streaming Too</p><p><br></p><p>Supported link of Content TV Shows,Movies &amp; Sports (Server Url,Local Upload and Embeded Code)</p><p><br></p><p>Live TV (m3u8 url,Embeded Code, Youtube)</p><p><br></p><p>Download Option</p><p><br></p><p>Player which is played within details screen</p><p><br></p><p>Movie,Shows and Sport have 3 quantity (Server Url and Upload from system Upload Type)</p><p><br></p><p>Movie,Shows and Sport have multiple 3 language subtitle (Server Url and Upload from system Upload Type)</p><p><br></p><p>Like, comment and engage with content.</p><p><br></p><p>Make followers easily by boosting profile.</p><p><br></p><p>Instagram like animated, double tap to like.</p><p><br></p><p>Instagram type look</p><p><br></p><p>Clutter-free playback and recording modes.</p><p><br></p><p>Login with Facebook, Google, Phone and twitter.</p><p><br></p><p>Follow, unfollow your favorite creators.</p><p><br></p><p>Show follow suggestions after login.</p><p><br></p><p>Real time one-to-one messaging.</p><p><br></p><p>Send cool stickers in chats and comments.</p><p><br></p><p>Send gifts to any user.</p><p><br></p><p>Instagram type live features.</p><p><br></p><p>Send gifts to user on video, profile, even live streaming also.</p><p><br></p><p>Block or unblock users.</p><p><br></p><p>Instant push notifications with FCM.</p><p><br></p><p>Deep-linked notifications to in-app content.</p><p><br></p><p>Manage user verification status.</p><p><br></p><p>Share links or videos directly to social networks.</p><p><br></p><p>In-app purchase.</p><p><br></p><p>Disapprove inappropriate videos.</p><p><br></p><p>Download and share with watermark + username.</p><p><br></p><p>Record new video or upload existing.</p><p><br></p><p>Choose music from phone, library or existing video.</p><p><br></p><p>Recording with start/stop timer.</p><p><br></p><p>In-app audio adjustments i.e., latency &amp; volume.</p><p><br></p><p>Request verifications with ID upload.</p><p><br></p><p>Apply filters to existing videos.</p><p><br></p><p>Auto-complete mentions and hashtags.</p><p><br></p><p>Privacy on video clips and comments.</p><p><br></p><p>Save failed uploads in drafts.</p><p><br></p><p>Start hashtag challenges from admin panel.</p><p><br></p><p>Customizable about screen.</p><p><br></p><p>Emoji keyboard (iOS, Google, Facebook &amp; Twitter).</p><p><br></p><p>Custom image (GIF/JPG/PNG) + link ads from admin panel.</p><p><br></p><p>Promotional banners from admin panel.</p><p><br></p><p>Categories</p><p><br></p><p>Sub Categories</p><p><br></p><p>Add Channel</p><p><br></p><p>View Channels</p><p><br></p><p>Channel Subscribers</p><p><br></p><p>Add Category</p><p><br></p><p>View Categories</p><p><br></p><p>Multiple Ad Spaces</p><p><br></p><p>Create Ad</p><p><br></p><p>View &amp; Assign Ad</p><p><br></p><p>Assigned ADS</p><p><br></p><p>Create Banner Ad</p><p><br></p><p>Subscriptions</p><p><br></p><p>Add Subscription</p><p><br></p><p>View Subscriptions</p><p><br></p><p>Auto-Renewal Users</p><p><br></p><p>Auto-Renewal Cancelled Users</p><p><br></p><p>Promocode Option</p><p><br></p><p>Add Coupon</p><p><br></p><p>View Coupons</p><p><br></p><p>Custom Push</p><p><br></p><p>Live Televisions</p><p><br></p><p>Advertises</p><p><br></p><p>Video Advertises</p><p><br></p><p>Live Video Play</p><p><br></p><p>m3u8 player</p><p><br></p><p>[login to view URL] Player with 4 Diffrent Design</p><p><br></p><p>Video Player Quality Features with Subtitle</p><p><br></p><p>Video Player with Chromecast</p><p><br></p><p>Video Player Supported These Formate (MP4, MKV, MOV, WEBM, M3U8, MPD)</p><p><br></p><p>Paid Video Restrictions</p><p><br></p><p>Upload a video from the panel</p><p><br></p><p>Logo &amp; Favicon</p><p><br></p><p>support Tickets</p><p><br></p><p>all Login History</p><p><br></p><p>Manage user profile</p><p><br></p><p>Privacy setting</p><p><br></p><p>Users</p><p><br></p><p>users : View, Edit, Delete</p><p><br></p><p>Posts: View, Delete</p><p><br></p><p>Sounds Categories</p><p><br></p><p>Sounds</p><p><br></p><p>Profile Categories</p><p><br></p><p>Verification Requests for blue tick</p><p><br></p><p>reported users and posts</p><p><br></p><p>Coin rates</p><p><br></p><p>Sliders</p><p><br></p><p>Two type of Content Free/Premium</p><p><br></p><p>For Premium content must need to subscribe</p><p><br></p><p>Subscription Plans</p><p><br></p><p>Subscriber Manager</p><p><br></p><p>Coins Plans and Pricing</p><p><br></p><p>FREE Plans</p><p><br></p><p>Automatic Gateways</p><p><br></p><p>Manual Gateways</p><p><br></p><p>Subscribe have Paypal,Stripe, Paystack &amp; Razorpay payment gateway</p><p><br></p><p>Explore Videos: For you &amp; Following</p><p><br></p><p>Explore page to check trending hashtags and videos</p><p><br></p><p>Like, comment, share, download videos</p><p><br></p><p>Search for posts and users</p><p><br></p><p>Explore videos by hashtags</p><p><br></p><p>Create and scan QR codes of profiles</p><p><br></p><p>Notifications</p><p><br></p><p>Coin wallet</p><p><br></p><p>Create videos on sounds</p><p><br></p><p>Create videos on the same sound of other video</p><p><br></p><p>Post your videos from gallery</p><p><br></p><p>Place Redeem Requests</p><p><br></p><p>Purchase coins</p><p><br></p><p>Send coins to other users</p><p><br></p><p>See videos by sounds</p><p><br></p><p>Manage About Us, Contact Us and Other Extra Pages</p><p><br></p><p>Advanced Search Options</p><p><br></p><p>Movies, Shows And Sports Videos List with Filter Option</p><p><br></p><p>Language and Genres Based Videos List</p><p><br></p><p>Live TV Streaming with Different Server Option</p><p><br></p><p>Ad Management</p><p><br></p><p>Promocode Option</p><p><br></p><p>Trailer and Content Rating Option</p><p><br></p><p>Menu Show/Hide Form Admin</p><p><br></p><p>Login &amp; Register Required For Paid Video</p><p><br></p><p>Login and Register</p><p><br></p><p>Skills: Flutter, PostgreSQL Administration, Backend Development, Database Development, Database Management, Frontend Development, Software Architecture, SQL</p>', '<p>No</p>', 12, 268, 12, '2022-12-31', '2023-02-11', NULL, 2, 169, 1, NULL, 'disable', 'disable', NULL, 'disable', 100, 'false', 250.00, -950, 1200, 5, 1, NULL, 'finished', NULL, 0, 'Accepted', 75, 1, 'lpumMv9c4q3FK18U4fDHqLwGuxES3jkR', 0, '2022-12-31 00:32:05', '2022-12-31 02:08:49', NULL),
