(102, NULL, 'PSEOP178CUTP-102', 'Home Page Design', '<p>Looking for a talented developer to build a Recruitment platform. In simple terms the platform or web application can be thought of as a stand alone version of LinkedIn\'s Recruiter tool. There will be no social elements like social messaging, networking or feeds. Job seekers will only have the ability to create profiles, upload work examples and respond to messages form employers. Employers will also have the ability to create profiles but with the added functionality to search for candidates with skills they want and contact them via direct message. The features are quite simple but will need to be executed well with clean code that can be built on in future. If you feel you can get the job done but would like to present a counter offer for your quote, please provide a quote you feel will best enable you get the job done efficiently and effectively.</p><p>Skills: HTML, Laravel, Backend Development, Full Stack Development, PHP, Software Architecture, Software Development, Web Application, Web Development</p>', '2023-01-03', NULL, '2022-12-31', 257, 1, 'medium', 'completed', 'approved', 4, 0, '2022-12-31 00:00:00', 15, NULL, NULL, 240, 0, 0, 24, 0, 15, 15, 'rdfFL80xZBmxoKVcvUbJs9Jj6KLmbhCf', 0, 0, NULL, 'day', NULL, NULL, '2022-12-30 21:45:40', '2022-12-30 22:50:57', NULL);
